import React from 'react'
import {Link} from 'react-router-dom'
const navLinks = [
    {
        title: 'Home',
        path: '/'

    },
    {
        title: 'Blog',
        path: '/blog'
    },
    {
        title: 'Contact Us',
        path: '/contact-us'
    },


]

export default function Navigation() {
    return (
        <nav className="site-navigation">
            <span>My React Blog</span>
            <ul>
                {  navLinks.map((link, index) => (
                    <li key={index}>
                       <Link to={link.path}> {link.title}</Link>
                    </li>


                ))}
            </ul>

    </nav>)
}
